import React, {useState} from "react";
import './App.css';
import NewsFeed from "./components/newsfeed/newsfeed";
import TopBar from "./components/TopBars";
import CreatePost from "./components/createpost/createPost";
import TopBar2 from "./components/TopBars2";

// eslint-disable-next-line
const App = () => {


    const [tab, setTab] = useState("newsfeed")
    const tabNames = ["Newsfeed", "Create"]
    const [tabChange, setTabChange] = useState(false);

    const onClick = ( () => {
        if (tabChange === false) {
            if (tab === "newsfeed") {
                setTab("newsfeed");
                setTabChange(true);
            } else {
                setTab("create");
                setTabChange(true);
            }
        }
        }
    )

    return (
        <div className="App">
            <TopBar2 onClick={onClick} text={tab} tabNames={tabNames}/>
            {/*<TopBar currentTab={currentTab}/>*/}
                {(tab === "newsfeed") ?
                    <NewsFeed />
                : (tab === "search") ?
                    <p>Coming soon</p>
                :(tab === "create") ?
                    <CreatePost />
                : (tab === "settings") ?
                     <p>Coming soon</p>
                : <p>TODO</p>
            }
        </div>
    );
}

export default App;
